// src/App.tsx
import React from 'react';
import './App.css';
import QueryForm from './QueryForm';
import FileUpload from './FileUpload';
import ChatInterface from './ChatInterface';

const App: React.FC = () => {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Electrical AI Dashboard</h1>
      </header>
      <main>
        {/* Chat interface */}
        <section className="section chat-section">
          <ChatInterface />
        </section>

        {/* Query interface for text-based questions */}
        <section className="section query-section">
          <QueryForm />
        </section>

        {/* File upload component for receipt analysis */}
        <section className="section upload-section">
          <FileUpload endpoint="upload_receipt" label="Upload Receipt" />
          {/* Uncomment below if you later implement diagram analysis:
          <FileUpload endpoint="analyze_diagram" label="Analyze Diagram" /> */}
        </section>
      </main>
    </div>
  );
};

export default App;
